import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import Logo from '../../assets/imagens/logo.png'; // Substitua com o caminho correto da sua logo

function Header() {
  return (
    <header className="header">
      <div className="logo">
        {/* Logo com imagem */}
        <Link to="#home">
          <img src={Logo} alt="Logo do Meu Portfólio" />
        </Link>
      </div>
      
      <nav className="navbar">
        <ul className="nav-links">
          <li><Link to="#about" className="nav-item">Sobre</Link></li>
          <li><Link to="#projects" className="nav-item">Projetos</Link></li>
          <li><Link to="#contact" className="nav-item">Contato</Link></li>
        </ul>
      </nav>
      
      {/* Botão de ação */}
      <div className="cta-button">
        <Link to="#contact" className="button">Baixar CV</Link>
      </div>
    </header>
  );
}

export default Header;
